import React from "react";
import NavBar from "../../assets/images/top-nav.png";
import SpaceBarMini from "../../assets/images/spacebar-mini.png";
import JblueryLink from "../../assets/images/jbluery-nav-logo.png";
import "../Navigation/Navigation.scss";

export default function Navigation() {
  return (
    <div className="NavBar">
      <img src={SpaceBarMini} className="NavBar__left" alt="Metaverse" />
      <img
        src={JblueryLink}
        className="NavBar__right"
        alt="Metaverse-home-link"
      />
      <img src={NavBar} className="NavBars" alt="NavBar" />
    </div>
  );
}
